import Header from './Main/Header'
import Features from './Features/Features'
import style from './Page.module.css'

const MainPage = () => {
  return (
    <div className={style.pageNormal}>
      <Header />
      <Features />
      <Action />
    </div>
  )
}

export default MainPage
